import React from 'react';

const ReminderList = (props)=> {
    
    return(
        <section className="reminder-list">
            <ul>
                {props.items.map(reminder => (
                    <li key={reminder.ItemId}>{reminder.description}</li>
                ))}
            </ul>
        </section>
    )
}

export default ReminderList;
